const initialState = {
    list: []
}

export default function ListReducer(state = initialState, action) {
    console.log('action.list is:', action.list);
    switch (action.type) {
        case 'SET_LIST':
            return {
                ...state,
                list: action.list
            }
        default: return state
    }

}
